  [],\n\t\"revision_timestamp\": \"2015-07-08T19:19:53.688869\",\n\t\"name\": \"omi-aura-ozone-o3-doas-total-column-daily-l2-global-0-25-deg-lat-lon-grid-v003\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The OMI/Aura Level-2G Total Column Ozone
  Data Product OMDOAO3G (Version 003)  is now available ( http://disc.gsfc.nasa.gov/Aura/OMI/omdoao3g_v003.shtml
  ) from the NASA Goddard Earth Sciences Data and Information Services Center (GES
  DISC) for the public access.nnOMI provides two Level-2 total column ozone products
  (OMTO3 and OMDOAO3) based on two different algorithms. This Level-2G global total
  column ozone product is derived from OMDOAO3 which is based on the Differential
  Absorption Spectroscopy (DOAS) fitting technique that essentially uses the OMI visible
  radiance values between 331.1 and 336.1 nm. In addition to the total ozone column
  this product also contains some auxiliary derived and ancillary input parameters
  e.g. ozone slant column density, ozone ghost column density etc. The short name
  for this Level-2 OMI ozone product is OMDOAO3G and the lead Algorithm scientist
  for this product and for OMDOAO3 (the data source of OMDOAO3G) is Dr. Pepijn Veefkind
  from KNMI.nn(The shortname for this Level-2G OMI Total Column Ozone product is OMDOAO3G)nOMDOAO3G
  product files are stored in Hierarchical Data Format (HDF-EOS5).  Each daily file
  contains data from the day lit portion of the orbits (approx 14 orbits) and is roughly
  80 MB in size. nnA Readme document containing brief algorithm description and known
  data quality related issues and file spec are provided by the OMDOAO3 Algorithm
  lead.nnData Category & Parameters:n   nThe OMDOAO3G data file consists of a GRIDS
  Data Object callednColumnAmountO3 which contains complete information for each pixelnbinned
  into each grid.n    n      Ozone Parameters (and Precision):n      Column Amount
  O3, Slant Column Amount O3, Ghost Column Amount O3n      n   Ancillary Data:n     Scene
  Reflectivity, Cloud Fraction, Cloud Pressure, n     Terrain Pressure, Terrain Height,
  Terrain Reflectivity,n     Air Mass Factor, Effective Temperaturen         n  Quality
  Flags:n      Ground Pixel Quality Flags, Measurement Quality Flags, n      Processing
  Quality Flags, Root Mean Square Error of Fit nn   Time and Geolocation Data:n      Time,
  Latitude, Longitude, Solar Zenith Angle, Solar Azimuth Angle, n      Viewing Zenith
  Angle, Viewing Azimuth Angle, Line Number, Scene Number, n      Number of Candidate
  Scenes, Path Length, Orbit Number, n      Spacecraft Info (altitude, latitude, longitude)\",\n\t\"license_title\":
